import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import TrueFalseSelectionsComponent from "./TrueFalseSelectionsComponent";
import {Grid} from "@material-ui/core";


const useStyles = makeStyles({
    root: {
        minWidth: 275,
    },
    selectContainer: {
        display: 'flex',
        flexWrap: 'nowrap'
    },
    selection: {
        width: '100%'
    },
    bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
});


const FiltersComponent = () => {
    const classes = useStyles();

    return <Card className={classes.root}>
        <CardContent>
            <Typography variant="h5" component="h2">
                Product Query and Filters
            </Typography>
            <Grid container spacing={1} style={{marginTop: '10px'}}>
                <Grid item xs={12} md={4}>
                    <TrueFalseSelectionsComponent className={classes.selection} selectionName="Add to Cart"/>
                </Grid>
                <Grid item xs={12} md={4}>
                    <TrueFalseSelectionsComponent className={classes.selection} selectionName="bopisAddToCart"/>
                </Grid>
                <Grid item xs={12} md={4}>
                    <TrueFalseSelectionsComponent className={classes.selection} selectionName="hasMoreOptions"/>
                </Grid>
            </Grid>
        </CardContent>
        <CardActions>
            <Button size="small">Reset All</Button>
        </CardActions>
    </Card>
}

export default FiltersComponent
